import { Container, Row, Col } from "react-bootstrap";
import { Link } from "react-router-dom";
const FooterComponent = () => {
  return (
    <Container className="w-100 h-25 pt-5">
      <Row xs={4} md={4} lg={4}>
        <Col>
          <Link to="/login">Account</Link>
        </Col>
        <Col>
          <Link>Account</Link>
        </Col>
        <Col>
          <Link>Account</Link>
        </Col>
        <Col>
          <Link>Account</Link>
        </Col>
      </Row>
    </Container>
  );
};

export default FooterComponent;
